import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import ItemList from "../components/itemList.js";
import { observer } from "mobx-react-lite";
const Shop = observer(({cart, setCart}) => {
  return (
<Container>
<Row className="mt-2">
  <Col md={10}>
    <ItemList/>
  </Col>
</Row>
</Container>
  );
})

export default Shop;
